import React, { Component } from 'react'

class Search extends Component{

	render() {
		return (
			<div>
				<form className="form">
					<input 
						type="text" 
						name="text" 
						placeholder="Search Users..." 
						value=''
						onChange={onChange}
					/>
					<input type="submit" value="Search" className="btn btn-dark btn-block"/>
				</form>
			</div>
		)
	}
}


const onChange = (e) => {
	e = e.target.value
}

export default Search
